I&#x27;ve been writing a lot of JavaScript and Python lately. I like Python&#x27;s syntax, so I created a language called Pith that&#x27;s JS with some Python-like syntax (but without trailing colons).<p>It&#x27;s not a full compiler. It really just does search-and-replace, but I find it fun and useful in spite of some sharp edges. I use it on my smartphone to write and run short programs.<p>Here&#x27;s an example using the HN API:<p><pre><code>  max = 6
  ids = await getApi(&#x27;topstories&#x27;)
  for id in ids.slice(0, max)
    getItem(id)

  async def getItem(id)
    const d = document.createElement(&#x27;div&#x27;)
    results.appendChild(d)
    d.style = &#x27;padding-bottom: 1em;&#x27;
    i = await getApi(&#x27;item&#x2F;&#x27; + id)
    ? i.title, &#x27;|&#x27;, i.score
    u = &#x27;&#x2F;&#x2F;news.ycombinator.com&#x2F;item?id=&#x27;
    d.innerHTML = i.title.link(u + id)

  async def getApi(path)
    u = &#x27;&#x2F;&#x2F;hacker-news.firebaseio.com&#x2F;v0&#x2F;&#x27;
    return getJson(u + path + &#x27;.json&#x27;)</code></pre>
